 can elicit rapid nongenomic effects both in vivo and in vitro , often mediated by signal transduction cascades . However , it is not understood how these rapid effects are initiated . In this study we show that aldosterone leads to rapid activation of mitogen activated protein kinases

 activators are enzymes found in all vertebrate species investigated so far . Their physiological function is the generation of localized proteolysis in the context of tissue remodeling , wound healing and neuronal plasticity . The common vampire bat ( Desmodus rotundus ) is a New World species that feeds exclusively on blood . Its saliva contains highly potent plasminogen activators , specialized in rapid lysis of fresh blood clots . Biochemical and pharmacological evidence indicates that these plasminogen activators represent a new class of thrombolytics with pharmacological and toxicological properties superior to human tissue-type plasminogen activator , the clot dissolving agent now most frequently used in medicine . A form of the enzyme produced by recombinant DNA technology is currently employed to test this hypothesis in clinical studies .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">[ The effect of blood pressure-reducing therapy with captopril on tubular marker excretion in type - 1 diabetics with nephropathy ] . A prospective open clinical trial was carried out with 23 hypertensive type I diabetics ( 13 men , ten women , mean age 49 + / - 9.1 years , duration of diabetes 18 + / - 9.1 years ) with early nephropathy . Glomerular and tubular renal function and metabolic parameters were monitored during 8 months ' treatment with the angiotensin converting enzyme ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P12821
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) inhibitor , captopril , in addition to previous antihypertensive treatment with one or more drugs . Blood pressure control tended to improve on captopril ( systolic pressures 152 + / - 13 vs 140 + / - 13 mm Hg , P &lt; 0.05 ; diastolic pressures 89 + / - 10 vs 87 + / - 10 mm Hg , not significant ) . Proteinuria ( &gt; 0.5 g / 24 hours ) fell into the microalbuminuria range ( albumin excretion 2-20 mg / mmol creatinine ) in four out of 13 patients , and microalbuminuria disappeared in four out of ten patients . Urinary levels of the brush border enzyme O60502 ( NAG ) , a marker of tubular dysfunction , were initially raised and fell significantly after 8 months ' treatment with captopril ( 20.3 + / - 14.4 vs 8.8 + / - 8.1 U / g creatinine ; P &lt; 0.01 ) . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 did not affect metabolic control ( HbA 1 , total , HDL and LDL cholesterol , triglycerides , apolipoproteins A1 and B ) or the insulin dosage . These results show that long-term treatment with captopril may favourably influence both albumin excretion and NAG activity , a marker of tubular dysfunction , in type I diabetics with nephropathy .</div>

<h2 style="margin: 0">19</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">

 repression of gonadotropin-releasing hormone gene transcription via enhancer 1 . DB00644 ( DB00644 ) plays a major role in the hypothalamic-pituitary-gonadal ( HPG ) axis , and synthesis and secretion of DB00644 are regulated by gonadal steroid hormones . Disruptions in androgen levels are involved in a number of reproductive defects , including hypogonadotropic hypogonadism and polycystic ovarian syndrome . Androgens down-regulate DB00644 mRNA synthesis in vivo and in vitro via an androgen receptor ( AR ) - dependent mechanism . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ( R1881 ) , a synthetic AR agonist , represses DB00644 expression through multiple sites in the proximal promoter . In this study , we show AR also represses DB00644 transcription via the major enhancer ( DB00644 - E1 ) . A multimer of the - 1800 / - 1766 region was repressed by R1881 treatment . Mutation of two bases , - 1792 and - 1791 , resulted in decreased basal activity and a loss of AR-mediated repression . AR bound to the - 1796 / - 1791 sequence in electrophoretic mobility shift assays , indicating a direct interaction with DNA or other transcription factors in this region . We conclude that AR repression of DB00644 - E1 acts via multiple AR-responsive regions , including the site at - 1792 / - 1791 .</div>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 acting through the androgen receptor ( AR ) maintains the arrest of spermatogonial differentiation in juvenile spermatogonial depletion ( jsd mutation in the Utp 14b gene ) mutant adult male mice . It is not known which of the somatic cell types expressing AR mediates this inhibition . To determine whether Sertoli cells are responsible , we selectively eliminated AR in Sertoli cells in jsd mice containing a floxed-Ar gene and an anti-Mllerian hormone-Cre transgene . In these Sertoli AR-knockout ( SCARKO ) - jsd mice , spermatogonial differentiation did not recover . However , the normal organization of Sertoli cell nuclei was drastically disrupted in SCARKO-jsd mice compared with SCARKO or jsd mice . In addition , the extent of ectoplasmic specializations was reduced ; tight junctions were not found ; vinculin , an anchoring protein found in ectoplasmic specializations , became uniformly distributed in the cytoplasm ; and the adult Sertoli cells showed excess heterochromatin subjacent to their nuclear envelope . Despite the abnormalities in Sertoli cells in SCARKO-jsd mice , global suppression of testosterone action and levels was still effective in restoring the differentiated germ cells , and this was accompanied by an improved arrangement of Sertoli cell nuclei . We conclude that Sertoli cells are not targets for the testosterone-mediated inhibition of spermatogonial differentiation in jsd mice , and that both AR in Sertoli cells and the presence of differentiated germ cells contribute to maintaining the organization of Sertoli cells within the seminiferous tubules .</div>
